          <p className="text-[clamp(20px,7vw,80px)] font-medium  tracking-[clamp(-1.76px)] text-white">
            Make AI work for
            <span className="bg-clip-text text-transparent bg-gradient-to-r from-pink-500 via-pink-300 to-indigo-500 px-3">
              your brand
            </span>
          </p>
          <p className="text-[clamp(20px,7vw,80px)] font-medium  tracking-[clamp(-1.76px)] text-white">
            from today
          </p>
        </div>
      </div>
    </>
  );
};

export default HeroText;
